import React from 'react';
import './table1.css';

function Tdata(props) {
    return (
        <div className="table">

            <table className="table table1">
            <thead className="thead-dark">
                <tr>
                    <th>Country</th>
                    <th>cases</th>
                </tr>
            </thead>
            <tbody>
                {props.countries.map(country => (
               <tr>
                   <td>{country.country}</td>
                   <td>{country.cases}</td>
               </tr>
           ))}
           </tbody>
            </table>


        </div>
    )
}

export default Tdata;
